import React, { Component } from "react";
import "./App.css";

class App extends Component {
 render() {
  return (
   <div className="wrapper">
    <h1>Bestilling skjema</h1>
    <form>
    <div className="Fieldset">
      <label>
        Fornavn:
        <input id="name" />
      </label>
      </div>
      <div className="Fieldset">
      <label>
        Etternavn:
        <input id="name" />
      </label>
      </div>
    </form>
   </div>
  );
 }
}

export default App;
